import { AppBar, Toolbar, styled } from '@mui/material'
import React from 'react'
import { NavLink } from 'react-router-dom';

const NavBar = () => {
    const Tabs = (NavLink)

  return (
    <AppBar position='static'>
        <Toolbar>
            <Tabs to="/contact-list" exact>Contact List</Tabs>
        </Toolbar>
    </AppBar>
  )
}

export default NavBar
